//HTTP Request Variable
var request;

//Send Application Id Function
function send_application_id_data(application_id)
{
	//Disable Link Click
	$( "body" ).on( "click", "a", onClickDisable );

	//Show Loading Spinner Function Call
  	showLoadingSpinner();

  	//Error Variable
	var error = document.getElementById("error");

	//URL Where HTTP Request is going
	var url = "export_pdf.jsp?application_id="+application_id;

	//Create new HTTP Request
	if(window.XMLHttpRequest)
	{
		request = new XMLHttpRequest();
	}
	else if(window.ActiveXObject)
	{
		request = new ActiveXObject("Microsoft.XMLHTTP");
	}

	//Send the HTTP Request & Call Get Courses Data Function When Request Status Gets Changed
	try
	{
		request.open("GET",url,true);
		request.send();
		request.onreadystatechange = get_application_id_data;
	}
	//Exception Handling while Request going on
	catch(e)
	{
		//Hide Loading Spinner Function Call
		hideLoadingSpinner();
	}
}

